import './App.css';
import Home from './Components/Home'
import Visit from './Components/Visit';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' exact component={Home} />
        <Route path='/visit' component={Visit} />

      </Routes>
    </Router>
  );
}

export default App;
